                operand.set(j, operand.get(i) * operand.get(j));
                op.remove(i);
                operand.remove(i);
            } else if (op.get(i).equals("//")) {
                operand.set(j, operand.get(i) / operand.get(j));
                op.remove(i);
                operand.remove(i);
            } else if (op.get(i).equals("**")) {
                operand.set(j, (long) Math.pow(operand.get(i), operand.get(j)));
