            tempPrimeFactors.forEach(primeFactor -> {
                int count = 0;
                while (n % primeFactor == 0) {
                    n /= primeFactor;
                    count++;
                }
                primeFactors.add(primeFactor);
                for (int j = 1; j <= count; j++) {
                    primeFactors.add(primeFactor);
                }
            });
