        if (n < 2) {
            return new ArrayList<Long>();
        }
        ArrayList<Long> prime = new ArrayList<Long>();
        prime.add(2l);
        prime.add(3l);
        long current = 5;
        while (current <= n) {
            boolean isPrime = true;
            for (int i = 0; i < prime.size(); i++) {
                if (current % prime.get(i) == 0) {
                    isPrime = false;
                    break;
                }
            }
            if (isPrime) {
                prime.add(current);
            }
            current += 2;
        }
        return prime;

